import React from "react";
import "../../Styles/Shared/Navbar.scss";
import logo from "../../Assets/svg/logo.svg";

function Navbar() {
  return (
    <div className='navbar'>
      <div className='navbarLogo'>
        <img src={logo} alt='' />
        <h2>
          Pay<span>2Gate</span>
        </h2>
      </div>
    </div>
  );
}

export default Navbar;
